static void*
__cint_maddr__pemladrv_field_t(void* p, int mnum, cint_struct_type_t* parent)
{
    void* rv;
    pemladrv_field_t* s = (pemladrv_field_t*) p;
    switch(mnum)
    {
        case 0: rv = &(s->field_id);break;
        case 1: rv = &(s->fldbuf);break;
        case 2: rv = &(s->flags);break;
        default: rv = NULL; break;
    }
    return rv;
}

